features.script:
let rocket = parcel.getFeatureById('rocketvox')
let lp = parcel.getFeatureById('lpvox')
let smoke = parcel.getFeatureById('smoke')
let smoke2 = parcel.getFeatureById('smoke2')

let hatch = parcel.getFeatureById('hatch')

let m1 = lp.createAnimation('position')
let r1 = rocket.createAnimation('position')
let s1 = smoke.createAnimation('position')
let h1= hatch.createAnimation('position')
let s2 = smoke2.createAnimation('position')


r1.setKeys([{
  frame: 1500,
  value: rocket.position.add( new Vector3(0,0,10))

}
  ])

m1.setKeys([{
  frame: 1500,
  value: lp.position.add( new Vector3(0,0,10))
}
  ])

s1.setKeys([{
  frame: 1,
  value: smoke.position.add( new Vector3(0,0,0))}
  ])

s2.setKeys([{
  frame: 1500,
  value: smoke.position.add( new Vector3(0,-2,0))},{
    frame: 1501,
  value: smoke.position.add( new Vector3(0,0,0))}  
  ])

h1.setKeys([{
  frame: 1,
  value: hatch.position.add( new Vector3(0,0,0))},
  {frame: 1500,
  value: hatch.position.add( new Vector3(0,0,0))},
  {frame: 1600,
  value: hatch.position.add( new Vector3(-1,0,0))}
  ])

feature.on('click',e=>{
rocket.startAnimations( [r1] )
lp.startAnimations( [m1] )
smoke.startAnimations( [s1] )
hatch.startAnimations( [h1] )
smoke2.startAnimations( [s2] )
})

let rocket = parcel.getFeatureById('rocketvox')
let lp = parcel.getFeatureById('lpvox')
let smoke = parcel.getFeatureById('smoke')
let smoke2 = parcel.getFeatureById('smoke2')

let m1 = lp.createAnimation('position')
let r1 = rocket.createAnimation('position')
let s1 = smoke.createAnimation('position')
let s2 = smoke2.createAnimation('position')

let myAudioOrVideo = parcel.getFeatureById('countdown')

r1.setKeys([{
  frame: 1,
  value: rocket.position.add( new Vector3(0,0,10))},{
  frame: 1000,
  value: rocket.position.add( new Vector3(0,0,10))},{  
      frame: 3000,  
  value: rocket.position.add( new Vector3(0,50,10))  
}
  ])

m1.setKeys([{
  frame: 1,
  value: lp.position.add( new Vector3(0,0,10))},{
     frame: 1000,
  value: lp.position.add( new Vector3(0,0,10))},{  
    frame: 3000,
  value: lp.position.add( new Vector3(0,0,0))  
}
  ])

s1.setKeys([{
    frame: 1000,
  value: smoke.position.add( new Vector3(0,0,0))},{  
  frame: 3000,
  value: smoke.position.add( new Vector3(0,50,0))  
}
  ])

s2.setKeys([{
    frame: 1,
  value: smoke2.position.add( new Vector3(0,2,0))},{  
  frame: 3500,
  value: smoke2.position.add( new Vector3(0,-2,0))  
}
  ])

feature.on('click',e=>{
rocket.startAnimations( [r1] )
lp.startAnimations( [m1] )
smoke.startAnimations( [s1] )
smoke2.startAnimations( [s2] )
myAudioOrVideo.play()
})

